import React, {Component} from 'react';

import '../style/bootstrap-4.1.3-dist/css/bootstrap.css';
import '../style/app.css';

class App extends Component{
    constructor(props){
        super(props);
        this.state = {
            age : 20
        };
    }

    hand = () => {
        const age = {...this.state.age}
        age += 1
        this.setState(age)
    }

    render(){
        return(
            <div className="container">
                <h1 className="col-lg-12 title">Matcha {this.state.age}</h1>
                <button onClick={this.hand}>nj</button>
            </div>
        );
    }
}

export default App;
